import React from 'react';
import { 
  LandingDiv, DevsText, LandingContent
} from '../../styledComponents';
import LandingInfo from './LandingInfo';

const LadingTextComp = React.memo(() => (
  <DevsText>
    뎁스 devStory
  </DevsText>
));

const LandingPage = () => {
  return (
    <>
      <LandingDiv>

        <LadingTextComp />

        <LandingContent>

          <LandingInfo />

        </LandingContent>

      </LandingDiv>
    </>
  );
};

export default LandingPage;
